import { useCallback } from "react";
import IllustrationFinances from "../../components/IllustrationFinances";
import { useNavigate } from "react-router-dom";

const Div = styled.div`
  position: relative;
`;
const P = styled.p`
  margin: 0;
`;
const Div1 = styled.div`
  position: relative;
  font-size: var(--paragraph-2-size);
  font-family: var(--font-aclonica);
  color: rgba(51, 61, 75, 0.6);
  display: inline-block;
  width: 316px;
`;
const Parent1 = styled.div`
  position: absolute;
  top: 0px;
  left: 0px;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  gap: var(--gap-7xs);
`;
const GreetinInner = styled.div`
  position: absolute;
  top: 108px;
  left: 39px;
  width: 321px;
  height: 111px;
`;
const Div2 = styled.div`
  position: absolute;
  top: 16.8px;
  left: 131.5px;
  font-size: 16.8px;
  font-family: var(--font-acme);
  color: var(--color-white);
  text-align: left;
`;
const Wrapper = styled.div`
  position: absolute;
  top: 0px;
  left: 0px;
  border-radius: 12px;
  background-color: var(--color-goldenrod);
  width: 321px;
  height: 54px;
  overflow: hidden;
`;
const GreetinChild = styled.button`
  cursor: pointer;
  border: none;
  padding: 0;
  background-color: transparent;
  position: absolute;
  top: 608px;
  left: 16px;
  width: 321px;
  height: 54px;
`;
const Greetin = styled.div`
  position: absolute;
  top: 0px;
  left: 0px;
  border-radius: var(--br-mini);
  background-color: var(--color-white);
  width: 360px;
  height: 780px;
  overflow: hidden;
`;
const GreetingRoot = styled.div`
  position: relative;
  width: 100%;
  height: 780px;
  text-align: left;
  font-size: 24px;
  color: #333d4b;
  font-family: var(--font-abhaya-libre-extrabold);
`;
const Greeting = () => {
  const navigate = useNavigate();

  const onFrameButtonClick = useCallback(() => {
    navigate("/main");
  }, [navigate]);

  return (
    <GreetingRoot>
      <Greetin>
        <GreetinInner>
          <Parent1>
            <Div>충전 습관 기록</Div>
            <Div1>
              <P>{`전기차 충전 정보를 연결하여 `}</P>
              <P>다양한 혜택을 경험해보세요!</P>
            </Div1>
          </Parent1>
        </GreetinInner>
        <IllustrationFinances
          imageDimensions="/undefined23.png"
          illustrationFinancesIconWidth="100%"
          illustrationFinancesIconHeight="46.21%"
          illustrationFinancesIconPosition="absolute"
          illustrationFinancesIconTop="24.62%"
          illustrationFinancesIconRight="0%"
          illustrationFinancesIconBottom="29.18%"
          illustrationFinancesIconLeft="0%"
          illustrationFinancesIconMaxWidth="100%"
          illustrationFinancesIconOverflow="hidden"
          illustrationFinancesIconMaxHeight="100%"
        />
        <GreetinChild onClick={onFrameButtonClick}>
          <Wrapper>
            <Div2>시작하기</Div2>
          </Wrapper>
        </GreetinChild>
      </Greetin>
    </GreetingRoot>
  );
};

export default Greeting;
